import './App.css';
import UserOutput from './components/UserOutput/UserOutput';
import UserInput from './components/UserOutput/UserOutput';


function App() {
  let inputUserName = 'test-username';

  const usernameChangeHandler = (event) => {
    inputUserName = event.target.value; // valoarea inputului
  }

  return (

    <div>
      <UserInput changed={usernameChangeHandler} userName={inputUserName}/>
      <UserOutput userName={inputUserName}/>
      <UserOutput userName={inputUserName}/>
      <UserOutput userName="Gheorghe"/>
    </div>
  );
}

export default App;
